                <h2 style=""text-align:center""><b>Welcome To Java course</b></h2>
                <hr />
                <div>
                    <h1 class=""text-primary"">Java Methods</h1>
                </div><br>
                <p>A <span class=""font-weight-bold"">method</span> is a block of code which only runs when it is called.</p>
                <p>ou can pass data, known as parameters, into a method.</p>
                <p>Methods are used to perform certain actions, and they are also known as <span class=""font-weight-bold"">functions.</span></p>
                <p>Why use methods? To reuse code: define the code once, and use it many times.</p>
                <br>
                <h1 class=""font-weight-bold"">Create a Method</h1><br>
                <p>A method must be declared within a class. It is defined with the name of the method, followed by parentheses (). Java provides some pre-defined methods, such as <span class=""text-danger"" style=""background-color:light");
                WriteLiteral("gray\">System.out.println()</span>, but you can also create your own methods to perform certain actions:</p><br>\r\n");
                WriteLiteral(@"                <pre>
                public class Main {
                  static void myMethod() {
                    // code to be executed
                  }
                }
            </pre>

                <h1>Example Explained</h1><br>
                <ul>
                    <li><span class=""text-danger"" style=""background-color:lightgray"">myMethod()</span> is the name of the method</li>
                    <li><span class=""text-danger"" style=""background-color:lightgray"">static</span> means that the method belongs to the Main class and not an object of the Main class. You will learn more about objects and how to access methods through objects later in this tutorial.</li>
                    <li><span class=""text-danger"" style=""background-color:lightgray"">void</span> means that this method does not have a return value.</li>

                </ul><br>

                <h1 class=""font-weight-bold"">Call a Method</h1><br>
                <p>To call a method in Java, write the method's");
